不良','由于表面集结粘铝导致的不良','粘铝不良','由于表面集结粘铝导致的不良','2021-06-11'),(14,'314','Vết sần sùi','Trong quá trình ép đùn do khuôn bị rung tạo vết sần sùi trên bề mặt','押出振動による不良','挤压过程中　由于模具震动导致型材表面产生带有颗粒状的痕迹','挤压痕不良','挤压过程中　由于模具震动导致型材表面产生带有颗粒状的痕迹','2021-06-11'),(15,'315','Tổn thương mặt trong','Khiếm khuyết gây ra theo chiều dọc bởi phần tiếp giáp với mặt trong khuôn','内径ダイスマーク','由于模具原因造成的型材内壁连续纵线伤的不良','内壁模具伤','由于模具原因造成的型材内壁连续纵线伤的不良','2021-06-11'),(16,'316','Rỗ bề mặt','Lỗ xuất hiện trên bề mặt do ép','表面坑','由于压延导致型材表面出现凹坑','表面坑','由于压延导致型材表面出现凹坑','2021-06-11'),(17,'317','Lỗi bòng khí mặt ngoài ','Các vết lồi hoặc lõm do bong bóng trên bề mặt sản phẩm','外面フクレ異常','因型材表面有气泡造成的凸起或凹坑','外壁气泡不良','因型材表面有气泡造成的凸起或凹坑','2021-06-11'),(18,'318','Đen bề mặt','Các đường màu đen không đều xuất hiện trên bề mặt','型材表面黒線','表面出现无规则黑线','表面黑线','表面出现无规则黑线','2021-06-11'),(19,'319','Lỗi ngâm tẩm','Có các vết màu đen xuất hiện trên mặt sản phẩm sau khi ngâm NaOH','エッチング巻込不良','浸蚀后出现的型材端面有黑色夹杂物','浸蚀卷入不良','浸蚀后出现的型材端面有黑色夹杂物','2021-06-11'),(20,'320','Lỗi vết nứt cạnh','Các vết nứt không liền trên bề mặt sản phẩm sau khi ngâm NaOH','浸蚀边部裂纹不良','浸蚀后出现的样品端面非焊合上的裂纹','浸蚀边部裂纹不良','浸蚀后出现的样品端面非焊合上的裂纹','2021-06-11'),(21,'321','Lỗi đường dọc','\"Trong quá trình ép đùn_do tốc độ đùn cao xuất hiện các đường dọc bên trong và ngoài sản phẩm\"','拉伤不良','挤压过程中由于挤压速度快　造成外表面　内径出现的多条纵向拉伤','拉伤不良','挤压过程中由于挤压速度快　造成外表面　内径出现的多条纵向拉伤','2021-06-11'),(22,'322','Lỗi dính vải nỉ','\"Các vật liệu như nỉ bám vào bên ngoài sản phẩm do bong tróc của con lăn và băng tải\"','粘毛毡不良','挤压过程中由于毛毡辊、毛毡带脱落掉毛造成型材外表面粘附毛毡等异物','粘毛毡不良','挤压过程中由于毛毡辊、毛毡带脱落掉毛造成型材外表面粘附毛毡等异物','2021-06-11'),(23,'323','Lỗi điểm dừng','Sản phẩm cuối của lot nguyên liệu trước khi dừng được đánh dấu 323 và để dưới cùng của giá để hàng','停机痕不良','端材利用机种带有停机痕部位的素材要标记323并且下架保留','停机痕不良','端材利用机种带有停机痕部位的素材要标记323并且下架保留','2021-06-11'),(24,'324','Lỗi đóng gói','Vật liệu cuối cùng được đánh dấu bằng“△”sau khi bị cắt và đóng gói riêng','卷裂不良','端材利用机种切断后标记“△”　捆包进行单独保留　用于加工双杆部品','卷裂不良','端材利用机种切断后标记“△”　捆包进行单独保留　用于加工双杆部品','2021-06-11'),(25,'351','Lỗi khác','Mục này để ghi những lỗi không mong muốn_ cụ thể phải được ghi chú rõ ràng','其他不良','本工序内　上记项目以外的不良。（备注中须明确记录不良现象）','其他不良','本工序内　上记项目以外的不良。（备注中须明确记录不良现象）','2021-06-11'),(33,'0','Không có lỗi SP',NULL,NULL,NULL,NULL,NULL,NULL),(36,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL);
